import React, { Component } from 'react';
import './Panel.css';
import { url } from 'inspector';

export default class Panel extends Component {
    constructor() {
        super();
        this.state = {
            bodywork: true,
            energetic : false,
            location : false,
            therapist : false,
            scheduling : false,

            bodywork1 : "Bodywork",
            bodywork2 : " So much. So much text so much text so much texh texch text so much text so much texh texch text so much text so much texh texmuch text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much textmucSo much text so much text so much texh text so much text so much text",
            bodywork3 : "text where pic needs to be"

        };
    }

    render() {
        return (
            <div className="panel-wrap">
                    <div className="intro-text"><span className="span">Therapeutic Massage </span> <br></br> by <br></br> <span className="span">Name</span></div>
                    <div className="panel"> 
                        <div className="panel-left">
                        this.state.bodywork3]
                        </div>
                        <div className="panel-right">
                        <h2>{this.state.bodywork1}</h2>
                        <p>{this.state.bodywork2}</p>
                        </div>
                    </div>
                    <div className="border"></div>/>

            </div>

        );
    }
}
